import "./Contact.css";

const Contact = () => {
  return (
  <div className="contact">
    <div className="contact-title">
        <h1>Get in touch</h1>
        <img src="" alt="" />
    </div>
    <div className="contact-section">
        <div className="contact-left">
            <h1>Let's talk</h1>
            <p>I am curruntly avalible to take on </p>
        </div>
    </div>
  </div>
  )
}

export default Contact
